import Link from "next/link";

export const RightNav = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>صفحه اصلی</a>
          </Link>
        </li>
        <li>
          <Link href="/songs">
            <a>آهنگ</a>
          </Link>
        </li>
        <li>
          <Link href="/video">
            <a>موزیک ویدئو</a>
          </Link>
        </li>
        <li>
          <Link href="/about-us">
            <a>درباره ما</a>
          </Link>
        </li>
        <li>
          <Link href="/contact-us">
            <a>تماس با ما</a>
          </Link>
        </li>

        <style jsx>
          {`
            ul {
              list-style: none;
              display: flex;
              flex-flow: row-reverse nowrap;
            }

            li {
              padding: 18px 10px;
            }

            @media only screen and (max-width: 700px) {
              ul {
                display: none;
                flex-flow: column;
                direction: rtl;
                background: red;
                position: fixed;
                margin: 0;
                top: 0;
                right: 0;
                height: 100vh;
                width: 300px;
                padding-top: 3rem;
              }

              li {
                color: black;
              }
            }
          `}
        </style>
      </ul>
    </div>
  );
};
